    QuejosoOtros: false,
    AutoridadId: 175258110,
    Autoridad: "Leoba  Severiano  Meza",
    AutoridadOtros: false,
    FechaAuto: "2024-04-16T15:11:59.987",
    Sintesis:
      "Vista la cuenta secretarial que antecede, téngase por recibido el oficio de cuenta, mediante el cual la actuaria del Juzgado de Distrito en Materia Mercantil Federal en el Estado de Sinaloa, con residencia en Mazatlán, remite la solicitud de medios preparatorios a juicio ejecutivo mercantil firmada electrónicamente por ***, apoderado general de ***;\npor lo que, con la solicitud y anexos de cuenta, fórmese y regístrese el expediente en el libro electrónico de gobierno correspondiente con el número 17/2024.\nEn el caso, se observa que la promovente solicita los medios preparatorios a juicio ejecutivo mercantil con el objeto de que ***, confiese la deuda que ─sustenta─ contrajo al celebrar un contrato de apertura de crédito simple con ***.\nPara ello, narra en sus hechos las condiciones en que pactó el adeudo que se le atribuye a la futura demandada; sin embargo, no existe claridad en los hechos que expone, porque soslaya expresar las circunstancias de tiempo, modo y lugar en que acontecieron; cuestión que era necesaria para estudiar la procedencia de la acción intentada y la absolvente pueda conocer perfectamente cómo se adquirió el adeudo que se le atribuye.\nDentro de estas imprecisiones, se mencionan las siguientes:\n En el hecho dos se menciona que *** y su representada tienen una relación derivada del contrato de crédito simple que se firmó, pero no indica la fecha (día, mes y año) ni el lugar de suscripción.\n Tampoco refiere la forma de celebración del contrato, por ejemplo, si fue electrónicamente, banca móvil, etcétera; ni el número de cuenta que se otorgó.\n En el hecho tres aduce que la futura demandada dispuso de un crédito, pero es omisa en indicar la cantidad de la que dispuso.\n En el hecho tres menciona que a la fecha existe un adeudo por ***, pero no indica que conceptos comprende dicha cantidad de adeudo.\n En el hecho cuatro, indica que su representada se encuentra facultada para realizar el cobro del capital adeudado, con motivo de disposición de crédito, incluyendo accesorios, intereses ordinarios y moratorios en virtud del contrato de crédito, empero, soslaya especificar los tipos de accesorios que fueron pactados, en su caso.\n Además, en el mismo hecho cuatro aduce que el interés moratorio se pactó a razón del 3.08%, pero soslaya indicar si dicho porcentaje es generado diario, semanal, mensual, quincenal, anual u otro.\n También en el hecho cuatro, indica que ha transcurrido en exceso el término que tenía [la futura demandada] a partir de la disposición del crédito para liquidar el adeudo, pero omite mencionar cuando incumplió ***, con la obligación que se le atribuye, es decir, a partir de qué fecha se empezó a computar el plazo pactado. \n? Asimismo, en el hecho cuatro, no establece la forma en que se debería hacer el pago, ni el plazo, pues, si bien indica que estos quedaron establecidos en el capítulo II del contrato del crédito, tal documento fue extraviado, según declara bajo protesta de decir verdad la promovente, de manera que, no existe forma de que la futura demandada lo conozca.\nTales incongruencias, no pueden ser subsanadas con el simple hecho de requerir a la promovente para que aclare tales circunstancias, ya que ello implicaría, por una parte, suplir la deficiencia en la queja de la solicitante.\nEn consecuencia, ante las irregularidades apuntadas, se desechan los medios preparatorios a juicio ejecutivo mercantil que se examinan.",
