    SintesisHTML:
      "Vista la diligencia de cuenta, de la que se advierte que\nrepresentante legal de la demandada *******, así como el apoderado legal de\nla parte actora, comparecieron ante este órgano\njurisdiccional, y el primero de ellos manifestó que en\ncumplimiento de la sentencia de veintiocho de junio de dos\nmil veintitrés, exhibe el cheque número ********, por la\ncantidad de ***********, expedido por ******; y, por su parte, el segundo de\nlos comparecientes manifestó que es su deseo que el referido\ncheque se resguarde en este juzgado, para efecto de solicitar\nal Primer Tribunal Laboral Federal de Asuntos Individuales en\nel Estado de Sonora, con residencia en Hermosillo, que se le\nentregue en este órgano jurisdiccional.\nAtento a lo anterior, remítase vía mensajería acelerada,\na la autoridad exhortante Primer Tribunal Laboral Federal de\nAsuntos Individuales en el Estado de Sonora, con residencia\nen Hermosillo, el cheque antes referido, así como copia\ncertificada la diligencia de ejecución de sentencia; dado que\nal ser éste un órgano auxiliar del exhortante, no se encuentra\nen posibilidad de decidir el destino del documento en cita.\n\nAhora, respecto a lo solicitado por el apoderado legal de\nla parte actora, dígasele que se esté a lo acordado en el\nprimer párrafo de este acuerdo.",
