      "Con esta fecha se publicó en lista el contenido del proveído de siete de agosto de dos mil veintitrés, dictado en el en el cuaderno de despacho 18/2024 (orden 188/2024), formado con motivo del diverso 63/2024, remitido por el Tercer Tribunal Colegiado en Materias Civil y de Trabajo del Quinto Circuito, con residencia en Hermosillo, derivado del amparo directo 1032/2022, de su índice, en el cual se dictó acuerdo de tres de agosto del año en curso; asimismo, en la misma fecha, se le tiene por hecha la notificación por lista del contenido de los acuerdos de mérito, a la parte tercero interesada ********, en términos de los artículos 27, fracción I, inciso b), y 29, de la Ley de Amparo, dándole vista en los términos precisados en los acuerdos que se le notifica, quedando a su disposición en la secretaría correspondiente de este juzgado copia de los autos de tres y siete de agosto del año en curso, así como, una copia del oficio y anexo, con el que la autoridad responsable manifestó dar cumplimiento a la ejecutoria dictada en el amparo directo 1032/2022, asimismo, se le requiere para que dentro del plazo de tres días, contados a partir del día siguiente a aquel en que surta efectos la presente notificación, señale domicilio para oír y recibir notificaciones en Hermosillo, Sonora, con el apercibimiento que de no hacerlo, las subsecuentes, aun aquellas de carácter personal, se le harán por medio de lista que se publique en el Portal de Servicios en Línea del Poder Judicial de la Federación y se fije en los estrados del tribunal exhortante.",
