      "Téngase por recibido el exhorto de cuenta, proveniente del Segundo Tribunal Laboral Federal de Asuntos Individuales en el Estado de Sonora, con sede en Hermosillo, derivado del procedimiento ordinario laboral 72/203 de su índice.\n\nAhora bien, al encontrarse apegado a derecho, con fundamento en lo dispuesto en el numeral 753 de la Ley Federal del Trabajo, así como lo dispuesto por los artículos 81 y 82 del Acuerdo General Conjunto 12/2020, del Pleno del Consejo de la Judicatura Federal, que regula la integración y trámite de expediente electrónico y el uso de videoconferencias en todos los asuntos competencia de los órganos jurisdiccionales a cargo del propio Consejo; regístrese en el libro de comunicaciones oficiales recibidas y en el Sistema Integral de Seguimiento de Expedientes bajo el número de exhorto 167/2024 (número de orden 186/2024); fórmese cuadernillo único.\n\nPara dar cumplimiento a lo solicitado, se comisiona al actuario judicial adscrito a este juzgado, lleve a cabo en sus términos la encomienda oficial de cuenta.\n\nEn el entendido de que la notificación encomendada deberá tomarse en cuenta lo dispuesto en los artículos 27 y 29 de la Ley de Amparo.\n\nCumplido lo anterior, dese cuenta inmediatamente con el resultado de la diligenciación encomendada.\n\nCúmplase.",
