    Sintesis:
      "Con esta fecha se publicó en lista el contenido del proveído de veinte de junio de la presente anualidad, dictado en el juicio de amparo 422/2024-2-B del índice del Juzgado Tercero de Distrito en Materia Civil y de Trabajo en el Estado de Nuevo León, con residencia en Monterrey; asimismo, en la misma fecha, se le tiene por hecha la notificación y emplazamiento por lista del contenido del acuerdo de mérito, a la parte tercero interesada ******************, en términos de los artículos 27, fracción I, inciso c), y 29, de la Ley de Amparo, dándole vista en los términos precisados en el acuerdo que se le notifica, siendo requerida y apercibida en los términos indicados en el mencionado acuerdo, quedando a su disposición en la secretaría correspondiente de este juzgado copia simple de la demanda de garantías, escrito aclaratorio, auto de admisión, así como del proveído de veinte de junio de dos mil veintitrés, derivados del mencionado juicio de amparo del índice del juzgado exhortante; de igual forma, se le requiere para que dentro del término de tres días siguientes al en que quede legalmente notificado, señale domicilio dentro del área metropolitana de la ciudad de Monterrey, Nuevo León, para oír y recibir notificaciones, bajo el apercibimiento que de no hacerlo, las subsecuentes notificaciones, aún las de carácter personal, le surtirán efectos por medio de lista de acuerdos que se publique en el juzgado exhortante, de conformidad con el artículo 27, fracción II de la Ley de Amparo. ",
