    SintesisHTML:
      "agréguese el oficio signado electrónicamente de cuenta, se tiene a la Subdirectora Ejecutiva de lo Contencioso, de la Coordinación General Jurídica y Consultiva de la Comisión Federal para la Protección contra Riesgos Sanitarios de la Secretaría de Salud, en representación de la Directora Ejecutiva de Regulación de Estupefacientes, Psicotrópicos y Sustancias Químicas de la COFEPRIS, informando dar cumplimiento a la sentencia de catorce de abril de dos mil veintitrés.\n\nPara tal efecto, anexa copia certificada del oficio número COFEPRIS-CAS-DEREPSQ-15628-2024.\n\nAl respecto, dese vista a las partes por el término de tres días, contado desde el día siguiente al en que surta efectos la notificación de este proveído, para que manifiesten lo que a su derecho convenga.\n\nCon el apercibimiento de que en caso de no realizar manifestación alguna sobre el particular en la temporalidad indicada, este Juzgado resolverá sobre el cumplimiento dado con base en los elementos que obren en el expediente y los datos aportados por la autoridad denunciada.",
